import {Row} from 'reactstrap'
import { Cella } from './Cella';
import { Tavolo } from './Tavolo';

class TavoloGioco extends Component{
    render(){
        return(
            <div>
                <Tavolo/>
            </div>
            
        );
    }
}



export class Colonna extends Component{
    render(){
        return(
          	this.creaColonne()
        );
		}
		
		creaColonne(){
    let colonna=[];
        for(let i=0;i<6;i++){
            colonna.push(
            <Row><Cella/></Row>
            );
        }
    return colonna;
		}
}


export default TavoloGioco;
